import React, { useState } from "react";
import { Navbar, Nav } from "react-bootstrap";

function Navigation() {
  const [expanded, setExpanded] = useState(false);

  const handleNavExpand = () => {
    setExpanded(!expanded);
  };

  return (
    <Navbar expand="md" expanded={expanded} fixed="top">
      <Navbar.Brand href="#">
        <img
          src="https://picsum.photos"
          alt="Logo"
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{" "}
        My Logo
      </Navbar.Brand>
      <Navbar.Toggle
        onClick={handleNavExpand}
        aria-controls="responsive-navbar-nav"
      />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="#">Menu 1</Nav.Link>
          <Nav.Link href="#">Menu 2</Nav.Link>
          <Nav.Link href="#">Menu 3</Nav.Link>
          <Nav.Link href="#">Menu 4</Nav.Link>
          <Nav.Link href="#">Menu 5</Nav.Link>
          <Nav.Link href="#">Menu 6</Nav.Link>
          <Nav.Link href="#">Menu 7</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Navigation;
